import (
	context "context"
	fern "github.com/alias-object-pointer/fern"
	fernclient "github.com/alias-object-pointer/fern/client"
)

client := fernclient.NewClient()
err := client.Create(
	context.TODO(),
	&fern.CreateRequest{
		MapField: map[string]string{
			"key": "value",
		},
		ListField: []string{
			"test",
		},
	},
)
